import React from 'react';
import { FaChevIonDow } from "react-icons";
export const Sidebar =() =>{
    return(

        <div className="sidebar" data-testid="sidebar">
            <ul className="sidebar-generic">
                <li>Inbox</li>
                <li>Today</li>
                <li>Nextweek</li>
            </ul>
        </div>
        )
    ;
}
